import React from 'react' ;
import './App.css' ;
import {connect} from 'react-redux' ;

function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>
    </div>
  );
}

const mapStateToProps = state => ({

  data : state.data,
  error : state.error,
  isLoading : state.isLoading  

})


export default connect(
  mapStateToProps,
  mapDispatchToProps
)(App);
